import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import Footer from './footer';

const HomePage = () => {
  const [isMobileView, setIsMobileView] = useState(false);

  useEffect(() => {
    const handleResize = () => {
      setIsMobileView(window.innerWidth <= 1050);
    };
    handleResize();
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  const commonStyle = {
    backgroundColor: '#0D1117',
    color: '#C9D1D9',
    minHeight: '100vh',
    fontFamily: "'Roboto', sans-serif",
    padding: '40px 20px',
    boxSizing: 'border-box',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-between',
  };

  const containerStyle = {
    display: 'grid',
    gridTemplateColumns: isMobileView ? '1fr' : '1fr 1fr',
    alignItems: 'center',
    gap: '30px',
    maxWidth: '1200px',
    margin: '0 auto',
  };

  const cardStyle = {
    backgroundColor: '#161B22',
    padding: '30px',
    borderRadius: '8px',
    boxShadow: '0 4px 15px rgba(0, 0, 0, 0.2)',
    textAlign: 'left',
  };

  const headerStyle = {
    textAlign: 'center',
    marginBottom: '20px',
  };

  const buttonStyle = {
    padding: '10px 20px',
    margin: '5px',
    backgroundColor: '#238636',
    color: '#ffffff',
    textDecoration: 'none',
    borderRadius: '5px',
    fontSize: '16px',
    fontWeight: 'bold',
    transition: 'background-color 0.3s',
    border: 'none',
    cursor: 'pointer',
  };

  const buttonContainerStyle = {
    display: 'flex',
    gap: '10px',
    justifyContent: 'center',
    marginTop: '20px',
  };

  const projectsSectionStyle = {
    marginTop: '40px',
  };

  const projectCardStyle = {
    backgroundColor: '#161B22',
    padding: '20px',
    borderRadius: '8px',
    boxShadow: '0 4px 15px rgba(0, 0, 0, 0.2)',
    textAlign: 'center',
    color: '#C9D1D9',
  };

  const footerStyle = {
    marginTop: '40px',
    padding: '20px 0',
    textAlign: 'center',
    color: '#C9D1D9',
    borderTop: '1px solid #30363D',
  };

  return (
    <div style={commonStyle}>
      {/* Header Section */}
      <div style={containerStyle}>
        <div style={cardStyle}>
          <h1 style={{ fontSize: '2.5rem', fontWeight: 'bold' }}>Hi, I'm Mohammed ðŸ‘‹</h1>
          <p>
            I am a passionate <strong>Full Stack Developer</strong> with over 5 years of experience in
            coding, analyzing data, and solving complex problems.
          </p>
          <div style={buttonContainerStyle}>
            <Link
              to="/about"
              style={{ ...buttonStyle, backgroundColor: '#238636' }}
              onMouseEnter={(e) => (e.target.style.backgroundColor = '#2EA043')}
              onMouseLeave={(e) => (e.target.style.backgroundColor = '#238636')}
            >
              About Me
            </Link>
            <a
              href="https://react--portfolio.s3.eu-west-2.amazonaws.com/Mohammed+Bakhshi+CV+.pdf"
              download="Mohammed_Bakhshi_CV.pdf"
              target="_blank"
              rel="noopener noreferrer"
              style={{ ...buttonStyle, backgroundColor: '#238636' }}
              onMouseEnter={(e) => (e.target.style.backgroundColor = '#2EA043')}
              onMouseLeave={(e) => (e.target.style.backgroundColor = '#238636')}
            >
              View CV
            </a>
          </div>
        </div>

        <div style={cardStyle}>
          <h2>Skills & Interests</h2>
          <ul>
            <li>Web Development</li>
            <li>Data Science</li>
            <li>Machine Learning</li>
            <li>Gaming</li>
            <li>Reading</li>
          </ul>
        </div>
      </div>

      {/* Projects Section */}
      <div style={projectsSectionStyle}>
        <h2 style={{ textAlign: 'center', marginBottom: '20px' }}>Featured Projects</h2>
        <div
          style={{
            display: 'grid',
            gridTemplateColumns: isMobileView ? '1fr' : '1fr 1fr',
            gap: '20px',
            maxWidth: '1200px',
            margin: '0 auto',
          }}
        >
          <div style={projectCardStyle}>
            <h3>Project 1</h3>
            <p>A cool project description goes here. Showcase your skills!</p>
          </div>
          <div style={projectCardStyle}>
            <h3>Project 2</h3>
            <p>Another amazing project description goes here. Impress your employer!</p>
          </div>
        </div>
      </div>

      {/* Footer */}
      <footer style={footerStyle}>
        <p>Â© 2024 Mohammed Bakhshi. All rights reserved.</p>
        <div>
          <a href="https://github.com" style={{ margin: '0 10px', color: '#238636' }}>
            GitHub
          </a>
          <a href="https://linkedin.com" style={{ margin: '0 10px', color: '#238636' }}>
            LinkedIn
          </a>
        </div>
      </footer>
    </div>
  );
};

export default HomePage;
